query PageByPath(
  $path: String!
) {
  markdownRemark(frontmatter: {path: {eq: $path}}) {
    htmlAst
    frontmatter {
      path
      title
      language
      subtitle
      description
    }
  }
}

query BlogPostByPath(
  $path: String!
) {
  markdownRemark(frontmatter: {path: {eq: $path}}) {
    htmlAst
    frontmatter {
      date(formatString: "MMMM DD, YYYY")
      path
      title
      subtitle
      language
      description
      image {
        childImageSharp {
          fixed(width: 700) {
            ...GatsbyImageSharpFixed
            src
          }
          sizes {
            src
          }
        }
      }
    }
  }
}

fragment GatsbyImageSharpFixed on ImageSharpFixed {
  base64
  width
  height
  src
  srcSet
}

query IndexQuery {
  allMarkdownRemark(sort: {order: DESC, fields: [frontmatter___date]}, filter: {frontmatter: {category: {eq: "event"}}}) {
    edges {
      node {
        excerpt(pruneLength: 250)
        id
        frontmatter {
          title
          date(formatString: "MMMM DD, YYYY")
          path
          category
          subtitle
          language
          image {
            childImageSharp {
              fixed(width: 700) {
                ...GatsbyImageSharpFixed
                src
              }
            }
          }
        }
      }
    }
  }
}

fragment GatsbyImageSharpFixed on ImageSharpFixed {
  base64
  width
  height
  src
  srcSet
}

